import React from 'react';
import '../App.css';
import { Button } from './Button';
import './About.css';

function AboutSection() {
  return (
    <div className='about-container'>

    <h1>About</h1>
    <br />
    <div className='about-hough-container'>
    <br />
    <p>London-based Finance and Technology startup which designs, scopes and delivers Finance and Risk solutions.  </p>
    <br />
    </div>
    <br />

    <div className='about-image-container'>
    </div>
    <div className='about-adrian-container'>
    <h3>Founder: Adrian Hough, BCom, MBA</h3>
    <br />
    <p>Finance, Risk and Change experience working in institutions such as Deutsche Bank, RBC Capital and Bank of America.</p>
    <br />
    <p>Delivered Finance & Risk projects for Commodities, Structured Finance, Derivatives, Fixed Income and Emerging Markets businesses.</p>
    <br />
    <p>Winner of the 2019 'CFTE Onfido Extrapreneurship' competition and member of CFTE alumni board.</p>
    </div>
    </div>


  );
}

export default AboutSection;
